import React, {useState, useEffect, useRef} from 'react'

//this is customize bootstrap
import '../scss/all.css';

import '../jquery.js';
import '../bootstrap-5.2.1/dist/js/bootstrap.min.js';


const Login=()=>{
    return(
        <div className="d-flex justify-content-center align-items-center">
            <div calssName="d-flex">
                <form  className="alert alert-secondary " action=" http://localhost:8080/api/login" method="post">
                    <label>Username</label>
                    <input className="input-group ms-3"type="text" name="username" placeholder="Enter Username" required/><br/>
                    <label>Password</label>
                    <input className="input-group ms-3" type="password" name="password" placeholder="Enter Password" required/><br/>

                    <button type="submit">Login</button>
                </form>
            </div>
        </div>
    )
}

export default Login;
